import React from 'react';
import './App.css';
import pokemons from './data';
import Pokedex from './Pokedex';
import Pokemon from './Pokemon';

function App() {
  return (
    <div className="App">
      <h1> Pokedex </h1>
      {/* <Pokedex pokemons={pokemons} /> */}
      <Pokemon pokemon={pokemon[0]} />
    </div>
  );
}

export default App;
